var revertRole = function (inRoleStr, sUid) {


    var roleList = JSON.parse(inRoleStr);
    if (roleList.length > 45) {
        roleList.splice(45,1);
    }
    var tableList = ['role', 'item', 'assets', 'areasco', 'skill', 'soul', 'activity', 'niudan', 'asyncpvprival',
        'shop',
        'skip', 'mission', 'newplayer', 'asyncpvpbless', 'gift', 'achieve', 'magicsoul', 'physical',
        'misgroup', 'climb', 'alchemy', 'misfinish', 'vipinfo', 'logingift', 'minesweep', 'suit',
        'chartprize',
        'rune', 'shoplingli', 'rewardmis', 'fashion', 'activitycd', 'operateinfo', 'title', 'chartreward',
        'chartrewardgettime', 'exchange', 'monthcardreceive','askmagic','magicoutput',
        'soulsuccinct','succinctinfo','noticeinfo','playermagic','roletemple','qqmembergift','pets','advance',
        'petsattribute','coliseum','artifact','tomarry','marryinfo','xuanyan','marrymsg','rolestory'];



    var roleTable = _.object(tableList, roleList);

    roleTable.role[roleTable.role.length - 2] = utilSql.MysqlEncodeString(roleTable.role[roleTable.role.length - 2]);
    roleTable.item = roleTable.item[0];
    delete roleTable.skip;
    roleTable.assets = _.map(roleTable.assets, function (v, k) {
        return [roleTable.role[0], k, v];
    });
    roleTable.activitycd = _.map(roleTable.activitycd, function (v, k) {
        return [roleTable.role[0], k, v];
    });
    roleTable.suit = _.map(roleTable.suit, function (item) {
        return util.format('%j', item);
    });
    //神装数据

//    roleTable.artifact = _.map(roleTable.artifact, function (v, k) {
//        return [roleTable.role[0], k, v];
//    });
    var artifact = [];
    roleTable.artifact = _.map(roleTable.artifact, function (item) {
        artifact.push((item));
    });
    roleTable.artifact = artifact;

    //结婚数据
    var marryinfo = [];
    roleTable.marryinfo = _.map(roleTable.tomarry.marryInfo, function (item) {
        marryinfo.push(_.flatten(_.values(item)));
    });

    var xuanyan = [];
    roleTable.xuanyan = _.map(roleTable.tomarry.marryXuanYan, function (item) {
        xuanyan.push(_.flatten(_.values(item)));
    });

    var marrymsg = [];
    roleTable.marrymsg = _.map(roleTable.tomarry.marryMsg, function (item) {
        marrymsg.push(_.flatten(_.values(item)));
    });
    var tomarry = [];
    roleTable.tomarry = _.map(roleTable.tomarry.toMarry, function (item) {
        tomarry.push(_.flatten(_.values(item)));
    });

    roleTable.marryinfo = marryinfo;
    roleTable.xuanyan = xuanyan;
    roleTable.marrymsg = marrymsg;
    roleTable.tomarry = tomarry;
    //结婚数据  结束

    var scuccinctArray = [];
    _.map(roleTable.soulsuccinct, function (item) {
        scuccinctArray.push(_.flatten(_.values(item)));
    });
    roleTable.soulsuccinct = scuccinctArray;

    roleTable.rewardmis = [roleTable.role[0], roleTable.rewardmis];
    roleTable.chartprize = _.values(roleTable.chartprize[0]);
    roleTable.operateinfo = _.values(roleTable.operateinfo[0]);
    roleTable.succinctinfo = _.values(roleTable.succinctinfo[0]);
    roleTable.noticeinfo = _.values(roleTable.noticeinfo[0]);


    var sqlFormat = 'insert into %s values %s;';

    var sqlStrings = _.map(roleTable, function (value, table) {

        //屏蔽结婚数据
        if ('tomarry' == table || 'marryinfo' == table || 'marrymsg' == table) {
            return '';
        }

        if (!_.isArray(value)) {
            return '';

        }

        if (!value.length) {
            return '';

        }

        if (!_.isArray(value[0])) {
            return util.format(sqlFormat, table, utilSql.BuildSqlValues([value]));

        }

        return util.format(sqlFormat, table, utilSql.BuildSqlValues(value));

    });



    var sqlStringsAccountGlobal = util.format(sqlFormat, 'rolename', utilSql.BuildSqlValues([
        [roleTable.role[0],
            roleTable.role[2],
            roleTable.role[1],
            sUid,
            roleTable.role[17],
            roleTable.role[20]
        ]
    ]));

    var f_account_global = util.format('%s_%s_account_global.sql', sUid, roleTable.role[0]);
    fs.writeFileSync(f_account_global, sqlStringsAccountGlobal);



    var f_games = util.format('%s_%s_games.sql', sUid, roleTable.role[0]);

    sqlStrings.unshift('call sp_deleteRole(' + roleTable.role[0]+ ');');
    fs.writeFileSync(f_games, sqlStrings.join('\n'));

    console.log('revert script: %s, %s', f_account_global, f_games);

};


var revertRoles = function (inRoleStrArray, sUid) {

    for (var i in inRoleStrArray) {
        revertRole(inRoleStrArray[i], sUid)
    }
};


